query:
SELECT COUNT(*) as total_cycles FROM capital_budget_cycles;

SELECT name, startYear, endYear, COUNT(*) as count 
FROM capital_budget_cycles 
GROUP BY name, startYear, endYear 
HAVING COUNT(*) > 1;

SELECT id, name, startYear, endYear, totalBudget, status 
FROM capital_budget_cycles 
ORDER BY startYear DESC, name;

